import React, { Component } from "react";
import { List } from "antd";
import "./view6.css";
import "bootstrap/dist/css/bootstrap.css";
export default class View6 extends Component {
  selectUser = (user) => {
    this.props.changeSelectUser(user);
  };
  /*

<div className="header">User List</div>
        <List
          size="small"
          bordered
          dataSource={data}
          renderItem={(user) => (
            <List.Item onClick={() => this.selectUser(user)}>
              <div>{user.name + ":" + user.age}</div>
            </List.Item>
          )}
        />
      </div>


*/
  render() {
    const { obj, attr1, attr2 } = this.props;
    return (
      <div id="view6" className="pane">
        <div className="row">
          <div className="col-2">
            <div class="badge badge-primary text-wrap">Set X Axis</div>
            <ul className="list-group">
              {Object.keys(obj).map((attr) => (
                <li
                  className={
                    attr1 === attr
                      ? "list-group-item active"
                      : "list-group-item"
                  }
                  onClick={() => this.props.onSelectX(attr)}
                  key={attr}
                >
                  {attr}
                </li>
              ))}
            </ul>
          </div>

          <div className="col-2">
            <div class="badge badge-primary text-wrap">Set Y Axis</div>
            <ul className="list-group">
              {Object.keys(obj).map((attr) => (
                <li
                  className={
                    attr2 === attr
                      ? "list-group-item active"
                      : "list-group-item"
                  }
                  onClick={() => this.props.onSelectY(attr)}
                  key={attr + "2"}
                >
                  {attr}
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>
    );
  }
}
